} from "@/UI/Forms/FormFull/FormFullInterfaces";
import {
  IProtCmpdCounts,
  IProtCmpdTreeNodePair,
  MoleculeInput,
} from "@/UI/Forms/MoleculeInputParams/MoleculeInput";
import Alert from "@/UI/Layout/Alert.vue";
